import React, { useState } from "react";
// https://hn.algolia.com/api/v1/search?query=react
const HackerNews = () => {
  const [hits, setHits] = useState([]);
  return (
    <div>
      {hits.length > 0 && hits.map((item, index) => <h3 key={item}>{item.title}</h3>)}
    </div>
  );
};

export default HackerNews;
